import axios from "axios";
import { useEffect, useState } from "react";
import HeaderCust from "./HeaderCust";

function CustomerHistory(){
    const cid=sessionStorage.getItem("id")
    const [trans,setTrans]=useState([])
    useEffect(()=>{
        axios.get("http://localhost:8090/api/accounts/history/"+cid)
        .then(resp=>{
            console.log(resp.data)    
            setTrans(resp.data.data)        
        })
        .catch(err=>{
            console.log(err)
        })
    },[])

    return(
        <>
        <HeaderCust/>
        <div className="container-fluid"><br/>
            <div className="row">
                
                <div style={{paddingLeft:"2500px"}}>
                    
                    <table class="table">
						<thead class="thead-light">
							<tr>
								<th>Id</th>
								<th>Transaction Date</th>
								<th>Particulars</th>
								<th>Debit Amount</th>
								<th>Credit Amount</th>
							</tr>
						</thead>
						<tbody>
                            {trans.map(tran=>(
							<tr>
								<td>{tran.id }</td>
								<td>{tran.tdate }</td>
								<td>{tran.ttype }</td>
								<td>{tran.dramount==0 ? "" : tran.dramount}</td>
								<td>{tran.cramount==0 ? "":tran.cramount }</td>
							</tr>
                            ))}
						</tbody>
					</table>
                </div>
            </div>
        </div>
        </>
    )
}

export default CustomerHistory;
